script: |
  super -f text -I q2339.spq | sort > q2339.out

inputs:
  - name: q2339.spq
    data: |
      SELECT col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 * + col0 IN ( col2 ) OR cor0.col2 * col0 >= col2 * col0 * + col2;
  - name: tab1

outputs:
  - name: q2339.out
    data: |
      10
      13
      26
